const Footer = () => {
  return (
    <footer className="relative">
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1440 320"><path fill="#000000" fillOpacity="1" d="M0,224L1440,160L1440,320L0,320Z"></path></svg>


      <div className="absolute bottom-5 left-2/4 text-white md:bottom-0 text-[10px]">
        <h1>Developed By</h1>
        <h1>Dilip Sahu</h1>
      </div>
    </footer>
  )
}
export default Footer
